import React, { Component } from 'react'

export default class HeaderComponent extends Component {
  render() {
    return (
      <div>
        <header>
          <div className="Search">
            <input
              type="text"
              placeholder="Search"
              style={{
                marginTop: '30px',
                height: '20px',
                width: '50%',
              }}
            />
          </div>
        </header>
      </div>
    )
  }
}
